import styled from 'styled-components';

const HomeContainer = styled.div`
    .flex;
    .items-center;
    .justify-center;
    .flex-col;
    .text-pwhite;
    span {
        .text-pdark
    }
`
const PhotoContainer = styled.div`
    .mt-12;
    height: 35vh;
    width: 35vh;
    .p-4;
    border-radius: 50%;
    border: 5px solid #fff;
`;

const Photo = styled.img`
    max-height: 100%
`;

const Intro = styled.div`
    width: 70vw;
    .text-2xl;
    .mt-8;
    .align-center;
`;

const Home = () => {
    return (
        <HomeContainer>
            <PhotoContainer>
                <Photo src="/logo.png" alt="Vilva Athiban P B, The JS Jockey" />
            </PhotoContainer>    
            <Intro>
                I am Vilva, a JavaScript developer, International tech Speaker, Seasonal Blogger and YouTuber. I play with React, Redux, GraphQL, TypeScript, React Native on daliy basis.
            </Intro>
        </HomeContainer>
    );
}

export default Home;
